INSERT INTO Animes(AnimeID, AnimeTitle, AnimeDesc, TypeID, AiredBegin, AiredEnd, Premiered, Duration, PosterUrl) VALUES (548, CONCAT('Fushigiboshi no☆Futagohime'), CONCAT('In the hollow Mysterious Planet, seven kingdoms co-exist, all of them lit by the Sun', CHAR(39), 's Blessing from the Kingdom of the Sun, in the middle of the planet. The light of the core sun is necessary for the continued existence of all the kingdoms. Yet, something is causing the Sun', CHAR(39), 's Blessing to weaken. If something isn', CHAR(39), 't done, it will be the end of life in the Mysterious Planet. Fortunately, the twin princesses of the Sun Kingdom, Fine and Rein, have been endowed with the magic of the Prominence, and are looking for a way to fix things. <br>
